function initializeWeekCalendarInfo(a){a.WeekCalendarInfo=a.CalendarInfo.extend({customDefaults:{categories:null},customInitialize:function(b){this.set("categories",b.categories)},activateCategory:function(b){b.active=!b.active;_.each(b.masters,function(c){c.set("active",b.active)})},disactivateCategory:function(b){_.each(this.get("categories"),function(c){if(c.id==b){c.active=false;_.each(c.masters,function(d){d.set("active",false)})}})},categoryDisableOther:function(b){_.each(this.get("categories"),function(c){if(c.id!=b){c.active=false;_.each(c.masters,function(d){d.set("active",false)})}})},activateAllCategories:function(){_.each(this.get("categories"),function(b){b.active=true;_.each(b.masters,function(c){c.set("active",true)})})}})};